import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Navbar from "./components/Navbar";
import "./App.css";
import { Container, createTheme } from "@mui/material";
import { ThemeProvider } from "@mui/material";
import ActivePollsPage from "./pages/ActivePollsPage";
import InactivePollsPage from "./pages/InactivePollsPage";
import ManagePollsPage from "./pages/ManagePollsPage";
import CreatePollPage from "./pages/CreatePollPage";
import { AuthenticatorProvider } from "./customHooks/useAuth";

const theme = createTheme({
  typography: {
    fontFamily: ["Poppins", "sans-serif"].join(","),
    button: {
      textTransform: "none", 
    },
  },
});


function App() {
  return (
      <Router>
      <ThemeProvider theme={theme}>
      <AuthenticatorProvider>

        <Container fixed={true}>
        <Navbar />
          <Routes>
            <Route path="/" element={<ActivePollsPage />} />
            <Route path="/past-polls" element={<InactivePollsPage />} />
            <Route path="/create-poll" element={<CreatePollPage />} />
            <Route path="/manage-poll" element={<ManagePollsPage />} />
          </Routes>
        </Container>

        </AuthenticatorProvider>
      </ThemeProvider>
    </Router>

  );
};

export default App;
